import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './components/NavBar';

// Admin pages
import Dashboard from './admin/Dashboard.jsx';
import AddTenant from './admin/AddTenant.jsx';
import Tenants from './admin/Tenants.jsx'; // The wrapper admin page
import TenantList from './components/TenantList.jsx'; // Shared component

// User pages
import UserDashboard from './user/UserDashboard.jsx';

const App = () => {
  return (
    <Router>
      <NavBar />
      <div className="p-4 max-w-4xl mx-auto">
        <Routes>
          {/* Admin Routes */}
          <Route path="/admin" element={<Dashboard />} />
          <Route path="/admin/tenants" element={<Tenants />} />
          <Route path="/admin/add-tenant" element={<AddTenant />} />

          {/* User Routes */}
          <Route path="/user" element={<UserDashboard />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
